import React from "react";
import '../Styles/SignUp.css';

function SignUp() {
    return(
        <div id='signupBody'>
            <h2><center>SIGN UP FOR AN ACCOUNT WITH THE BANKERS TODAY!</center></h2>
        </div>
    )
}

export default SignUp;
